Es por eso que te traemos estas 3 ideas 💡 

1.Crea una experiencia de campamento dentro de casa con una tienda de campaña (o haz una con almohadas y sábanas).Puedes colgar algunas luces de Navidad para que parezcan estrellas en el cielo, hacer palomitas,recrea actividades y pasa una increíble noche con los niños. 

2.Cocina con ellos
Si a tu hijo le encanta ayudar en la cocina, busca recetas de sus postres o platillos favoritos y haz que participen al prepararlos. Cocina su desayuno pero mejorado, como unos hot cakes de unicornio, almuerzo, cena, snaks favoritos y un pastelito en casa. 

3.Invitados virtuales
