Hace una semana, en una reunión informal con algunas compañeras de @espailactancia, hablábamos de cesáreas, partos, sanitarios, hospitales y epidurales e inevitablemente acabé contando cómo la epidural me produjo una cefalea post-punción bastante incapacitante, que me obligó a estar tumbada durante 8 días. Tiempo en el que mi hijo, arrancado de mi lado, pasaba hambre, mientras yo me sentía vulnerable, sola, juzgada, incomprendida y abandonada.

Una de mis compañeras de Espai Lactància me preguntó por qué nunca lo había contado y yo le respondí que porque era triste para compartirla en nuestros encuentros, donde suele haber mamás puérperas o embarazadas. Quienes son las verdaderas protagonistas de nuestros encuentros.

Pero esta experiencia es en realidad el motor que me movió a iniciar este proyecto.
¿De verdad tenemos que pasar por esto? NO
Por eso me gustaría acompañar a madres que quieren hacer algo para evitar situaciones como esta.

